import React, { useState, useEffect } from 'react'
import { Row, Col, Form, Button } from "react-bootstrap"
import FormContainer from "../components/FormContainer"
import { useDispatch, useSelector } from "react-redux"
import Message from "../components/Message"
import { signForWorkout } from "../actions/workoutActions"

const ProfileScreen = ({history, match}) => {
    const dispatch = useDispatch()

    const [name, setName] = useState('')
    const [email, setEmail] = useState('')
    const [phoneNumber, setPhoneNumber] = useState('')


    const submitHandler = (e) => {
        e.preventDefault()
        dispatch(updateAdminProfile(match.params.id, name, email, phoneNumber))
    }

    return (
        <FormContainer>
            <h1 className="mt-5">Edit Profile</h1>
            { error && <Message variant="danger">{error}</Message>}
            { success && <Message variant="success">Admin Updated</Message>}
            <Form onSubmit={submitHandler}>
                <Form.Group>
                    <Form.Label>Name</Form.Label>
                        <Form.Control type="name" placeholder="Enter Name..." value={name} 
                        onChange={(e) => setName(e.target.value)} >  
                        </Form.Control>
                </Form.Group>
                <Form.Group>
                    <Form.Label>Email</Form.Label>
                        <Form.Control type="email" placeholder="Enter Email..." value={email} 
                        onChange={(e) => setEmail(e.target.value)} >  
                        </Form.Control>
                </Form.Group>
                <Form.Group>
                    <Form.Label>Phone Number</Form.Label>
                        <Form.Control type="number" placeholder="Enter Phone Number..." value={phoneNumber} 
                        onChange={(e) => setPhoneNumber(e.target.value)} >  
                        </Form.Control>
                </Form.Group>

                <Button type="submit" variant="primary">
                        Update
                </Button>
            </Form>    
        </FormContainer>
    )
}

export default ProfileScreen
